unsigned int {name}(unsigned int key, unsigned int seed)
{{
    unsigned long long h = (unsigned long long)key * ((unsigned long long)seed | 1);
    h ^= h >> 33;
    h *= 0xff51afd7ed558ccd;
    h ^= h >> 33;
    return (unsigned int)h;
}}

unsigned int {name}(unsigned int key, unsigned int seed)
{{
    unsigned int h = key * (seed | 1);
    h = (h ^ 61) ^ (h >> 16);
    h = h * 9;
    h = h ^ (h >> 4);
    h = h * 0x27d4eb2d;
    h = h ^ (h >> 15);
    h ^= (1 + h) << 13;
    h ^= h >> 17;
    h ^= h << 5;
    return h;
}}
